import React, { Component } from 'react';
import { NavLink } from "react-router-dom";

export class Home extends Component {
  render() {
    return (
        <div>
          <h2>Home</h2>
        </div>
    );
  }
}

export class Contact extends Component {
  render() {
    return (
        <div>
          <h2>Contact</h2>
        </div>
    );
  }
}

export class About extends Component {
  render() {
    return (
        <div>
          <h2>About</h2>
        </div>
    );
  }
}

export class NavigationPage extends React.Component {
  // constructor (props){
  //   super(props)
  // }
  render() {
    return (
    <div className="navigation">
      <nav id="MyNavBarId" className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
        <button id="NavBarButton" className="navbar-toggler" data-toggle="collapse" data-target="#NavBarCollaps" aria-controls="navbar" aria-expanded="false" aria-label="Toggle navigation">
          <span id="" className="navbar-toggler-icon"></span>
        </button>
          <div id="NavBarCollaps" className="collapse navbar-collapse justify-content-between">
          <a id="MyDivHomeId" className="navbar-brand" href="#Livret" data-toggle="collapse" data-target=".navbar-collapse.show">
            <span id="" className="">Afficher le Livret de Famille</span>
          </a>
          <a id="MyDivArbreId" className="navbar-brand" href="#Arbre" data-toggle="collapse" data-target=".navbar-collapse.show">
            <span id="" className="">Afficher l'Arbre de la Famille</span>
          </a>
          <a id="MyDivAlbumId" className="navbar-brand" href="#Album" data-toggle="collapse" data-target=".navbar-collapse.show">
            <span id="" className="">Afficher l'Album</span>
          </a>
        </div>
      </nav>
    </div>);
  }
}

export class NavigationPage2 extends React.Component {
    // constructor (props){
    //   super(props)
    // }
    render() {
      return (
        <div className="navigation">
          <nav className="navbar navbar-expand navbar-dark bg-dark">
            <div className="container">
              <NavLink className="navbar-brand" to="/">
                React Multi-Page Website
              </NavLink>
              <div>
                <ul className="navbar-nav ml-auto">
                  <li className="nav-item">
                    <NavLink className="nav-link" to="/">
                      Home
                      <span className="sr-only">(current)</span>
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to="/contact">
                      Contact
                    </NavLink>
                  </li>
                  <li className="nav-item">
                    <NavLink className="nav-link" to="/about">
                      About
                    </NavLink>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </div>
      );
    }
  }
// export default NavigationPage;
